import React from 'react'
import { Container, Row, Col, Text} from 'reactstrap'
import { Icon } from 'semantic-ui-react'
import {Link, NavLink} from 'react-router-dom'
import { Column } from 'ag-grid-community'
import Home from '././Home'
import {RadioGroup, Radio} from 'react-radio-group';
import { render } from '@testing-library/react'
import { Component } from '@angular/core'

class Registeration extends Component{
    constructor(props){
        super(props)

        this.state = {
            check1: false,
            check2: false,
            radio1: "apple"
        }
    }
    render(){
        return(
            <Container>
                <div>
                    <inut type="checkbox" name="check1" checked={this.state.check1}/> Fruits <br />
                    <inut type="checkbox" name="check1" checked={this.state.check1}/> Veges <br />


                </div>
                
                
                
    
                <Row>
                <Col>
                <div><li><Link to="/adoption">Back</Link></li></div>
                </Col>
                
            </Row>
            <Row>
                <Col>
                <div><li><Link to="/step3">Next</Link></li></div>
                </Col>
            
            </Row>
                           
            
            </Container>
        )
        
    }
    

}
export default Registeration;
